import Login from "./components/Login";
import Pic from "./components/pic";

function App() {
  return (
    <div className="flex flex-row-reverse ">
      <div className="bg-[#0f172a]">
        <div class="flex flex-col w-56 h-16 mt-2 ml-48 mr-20">
          <img
            src="bios.png"
            alt="bios"
            style={{ height: 200 }}
            className="ml-2 "
          ></img>
          <img
            src="preview.png"
            alt="pre"
            style={{ height: 100, width: 100 }}
            className="ml-16 "
          ></img>
        </div>

        <Login />
      </div>
      <div>
        <Pic />
      </div>
    </div>
  );
}

export default App;
